Schlechte Zeichen

Folge 1946

Die abergläubische Sophia schiebt Panik, als sie morgens auf dem Weg zum Arzt einen Spiegel zerbricht. Ausgerechnet heute, wo ihr die mit Jans Spermien befruchteten Eizellen eingesetzt werden sollen! Die Scherben müssen auf jeden Fall sieben Stunden liegen bleiben, um Schaden abzuwehren! Dennoch kann Sophia nicht anders, als den ganzen Tag den Einfluss dieses schlechten Vorzeichens zu spüren. Umso mehr als der Arzt sagt, dass von den zehn entnommenen Eizellen sich nur zwei zu Embryonen weiterentwickelt haben. Doch beim Einsetzen geht alles gut und Sophia und Jan schöpfen Hoffnung, nun ihrem Babytraum einen großen Schritt näher zu sein – bis Sophia daheim entdeckt, dass Jill die Scherben weggeräumt hat. Sie regt sich so auf, dass sie stolpert und ausgerechnet auf den Bauch fällt. Während Sophia und Jan direkt wieder zum Arzt eilen, wundern sich Freddy und Jill, was los ist. Sind die beiden krank? Oder doch schwanger? Zur Rede gestellt, verneinen Sophia und Jan nach ihrer Rückkehr vom Arzt die Frage nach der Schwangerschaft. Das wissen sie schließlich erst in zwei Wochen … (Text: RTLZwei)

